import React from 'react';
import DraggableItem from "./draggableItem";

class Artboard extends React.Component {

  render() {
    const style={
      "background": "#fff",
      "position": "absolute",
      "top": "50%",
      "left": "50%",
      "transform": "translate(-50%,-50%)"
      //"border": "solid 1px red"
    }

    const width=500;
    const height=400;

    return (
      <section style={{"position":"relative"}} className="section-artboard section-bottom">
      <svg id="svg" style={style} width={width} height={height}>
      <circle cx="50" cy="50" r="40" stroke="green" stroke-width="4" fill="yellow" />
      <DraggableItem />
      </svg>
      </section>
    );
  }
}

export default Artboard;
